import { Parallax, ParallaxLayer } from '@react-spring/parallax';

function App() {
  return (
    <div>
     <Parallax pages={4}>
        <ParallaxLayer>
          <h2> Welcome </h2>
        </ParallaxLayer>

        <ParallaxLayer offset={1}>
          <h2>Fuck you </h2>
        </ParallaxLayer>
     </Parallax>
    </div>
  );
}

export default App;
